#[cfg(test)]
mod test {
    use crate::solutions::p0649::Solution;

    #[test]
    fn leetcode_case_1() {
        assert_eq!(
            Solution::predict_party_victory(String::from("RD")),
            String::from("Radiant")
        )
    }

    #[test]
    fn leetcode_case_2() {
        assert_eq!(
            Solution::predict_party_victory(String::from("RDD")),
            String::from("Dire")
        )
    }

    #[test]
    fn leetcode_case_3() {
        assert_eq!(
            Solution::predict_party_victory(String::from("")),
            String::from("Radiant")
        )
    }
}
